import React, { useState } from "react";
import { Container } from "react-bootstrap";
import styled from "styled-components";

const Title = styled.h2`
  font-weight: 300;
`;

const CardContainer = styled.div`
  display: flex;
  flex-wrap: nowrap;
  overflow-x: auto;
  &::-webkit-scrollbar {
    display: none;
  }
`;

const Card = styled.div`
  background-color: gray;
  margin-right: 16px;
  width: 15rem;
  flex-shrink: 0;
  /* height:auto */
`;

const DogCarousel = () => {
    useState()
  return (
    <Container fluid className="py-2" style={{ overflowX: "hidden" }}>
      <h2 className="font-weight-light m-4">
        Bootstrap 4 Horizontal Scrolling Cards with Flexbox
      </h2>
      <CardContainer className="d-flex flex-row">
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">
          <img className="card-img-top" src="..." alt="Card image cap" />
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
          </div>
        </Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">
          Card 2
